(1,'20220727',NULL,NULL,157,35,0,1,'標高1450mの白樺リゾートで見る！ペルセウス座流星群と宇宙旅行体験ツアー（0727）','【8月出発限定】　肉眼でも観測できる真夏の天体ショー！3大流星群「ペルセウス座流星群」を見に行こう。これで貴方も星空博士！？『星空レンジャー』による星空講義付き。今年新登場の宇宙旅行体験も楽しめます♪','【ペルセウス座流星群とは？】\r\n○お盆の時期に活発になる流星群で、三大流星群の一つ。\r\n○好条件下では1時間に100もの流星が見られることも！？とても見応えのある流星群です。\r\n\r\n高原旬彩バイキング\r\n（レイクサイドプラザ）\r\n■（到着後・20時頃～21時）　\r\n○和食から洋食まで、バラエティ豊かな季節のお料理をご用意しております。\r\nお品書き：ご飯もの、麺類、旬の天ぷら、地元鍋、肉料理、サラダ、フルーツ、デザート\r\n池の平湯めぐりワールド\r\n（池の平ホテル）\r\n\r\n■自由入浴（22時～25時）\r\n○開放感たっぷり、1200坪の大自然に広がる大露天風呂を始め、陶器風呂、ひのき風呂、サウナなど多彩な湯処でリフレッシュできます。','2022-09-01','2022-09-02',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,2,0,NULL,NULL,NULL,3,0,17,0,0,0,0,10,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'ワクチン接種済ですか？',1,0,NULL,NULL,NULL,'origin-165899560923764183_m.jpg','origin-165899561024201965_m.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,NULL,'<p>テキスト</p>','長野県','夕食： あり','日帰り','2',1,NULL,NULL,'出発日の3日前',NULL,NULL,NULL,NULL,1,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-28 16:19:32','2022-08-02 17:16:03'),
(1,'20220730',NULL,NULL,160,36,0,1,'【神戸空港発着】5つの遊覧と5つの絶景3つの秘境　夏のオアシス信州・越後さわやか避暑地3日間','★2泊とも当社基準Aランクリゾートホテル、温泉のあるお宿へ\r\n★往復飛行機で楽々♪（往路：神戸空港→松本空港　復路：新潟空港→神戸空港）\r\n★信州から越後の涼景を3日間で効率よく観光！','5つの遊覧・5つの絶景・3つの秘境へご案内\r\n船・ロープウェー・テラス　様々なシチュエーションで景色をご堪能いただき\r\n個人ではなかなか訪れない秘境へもご案内致します\r\n　\r\n【絶景1】HAKUBA　MOUNTAIN　HARBOR　/　標高1290ｍの山頂テラス\r\n―ここが白馬の特等席\r\n\r\n【絶景2】高浪の池・明星山\r\n―標高540ｍの白馬山麗国民休養地内にあり、1年中満々と水をたたえる高原の池\r\n大岩壁で有名な明星山と湖が織りなす神秘的な風景は思わず息をのむほどです\r\n\r\n【絶景3】・【遊覧2】野尻湖遊覧船\r\n―さわやかな風と共に湖上を走る遊覧船\r\n―遊覧船で野尻湖を一巡り\r\n\r\n【絶景4】湯沢高原アルプの里\r\n―山頂付近では花々が眼の前に広がる\r\n\r\n【絶景5】・【遊覧5】八海山ロープウェー','2022-09-01','2022-09-30',0,NULL,1,1,1,1,1,1,1,1,1,NULL,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,1,0,10,2,0,0,0,10,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'料金に含まれるもの',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'予約者への質問',0,1,'注意事項・その他',NULL,NULL,'origin-165915432752040070003252340.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',1,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,'<p style=\"margin-right: 0px; margin-bottom: 19px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: 游ゴシック体, YuGothic, 游ゴシック, \"Yu Gothic\", メイリオ, \"Hiragino Kaku Gothic ProN\", \"Hiragino Sans\", sans-serif; word-break: break-all; color: rgb(51, 51, 51);\">予約確定後の取消しは、手数料が下記のように発生します。<br>なお、見積の取消による手数料はいただきません。</p><table class=\"table01 mb0\" style=\"margin: 30px 0px 0px; padding: 0px; border: 1px solid rgb(204, 204, 204); font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: 游ゴシック体, YuGothic, 游ゴシック, \"Yu Gothic\", メイリオ, \"Hiragino Kaku Gothic ProN\", \"Hiragino Sans\", sans-serif; border-spacing: 0px; width: 700px; color: rgb(51, 51, 51);\"><tbody style=\"margin: 0px; padding: 0px; border: 0px; font: inherit;\"><tr style=\"margin: 0px; padding: 0px; border: