(1,'20220801',NULL,NULL,161,39,4,1,'房総の人気テーマパーク☆鴨川シ－ワールド＆マザー牧場日帰りバスツアー','マザー牧場でかわいい動物たちがお出迎え。初夏のあじさいや桃色吐息の咲く光景は映えばっちり♪鴨シーでは迫力満点シャチのショーなど楽しみ方いっぱい。','●かわいい動物と季節の花々がお出迎え♪\r\n<マザー牧場>\r\n○広大な「まきば」では動物たちがのびのびと暮らしています。\r\n○うさぎやモルモットとの動物ふれあいやイベントショーなど盛り沢山！\r\n○牧場内の工房で作られたハム・ソーセージや、新鮮な生乳をふんだんに使用したソフトクリームなど牧場グルメも充実。\r\n\r\n●一面に広がるピンクの絨毯\r\n<桃色吐息の絶景>\r\n○7～9月は25,000株のペチュニア「桃色吐息」が山の斜面を覆うように咲き誇ります。\r\n○「桃色吐息」はペチュニアを品種改良したもの。南房総出身の園芸家 杉井明美さんと千葉大学との共同開発で生まれた品種です。\r\n○一面に広がるその光景はまさにピンクの絨毯♪また、風でゆらゆらと揺れる姿も可愛らしく涼しげです。\r\n\r\n●房総の人気水族館\r\n<鴨川シーワールド>\r\n○シャチに会える水族館として子供から大人まで大人気！\r\n○野外スタジアムでは、シャチはもちろんイルカやアシカなど迫力満点パフォーマンスが楽しめます。\r\n○人気のカクレクマノミなど、海洋生物が暮らす水槽エリアはフォトジェニック♪\r\n\r\n※入園料込み','2022-09-29','2022-09-30',0,NULL,0,0,0,0,0,0,0,1,1,NULL,NULL,NULL,NULL,NULL,2,0,NULL,NULL,NULL,0,0,17,0,0,0,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'ワクチンを接種してますか？',1,1,'注意事項・その他',NULL,NULL,'origin-165941983124141346_s.jpg','origin-165941983124264971_s.jpg','origin-165941983124272274_s.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,NULL,'<table cellspacing=\"1\" cellpadding=\"0\" summary=\"cancel\" style=\"margin: 1em auto 35px; padding: 0px; border: 0px; font-size: 12px; vertical-align: baseline; border-spacing: 0px; max-width: 100%; width: 700px; text-align: center; color: rgb(0, 0, 0); font-family: Meiryo;\"><tbody style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\"><tr style=\"margin: 0px; padding: 0px; border: 1px solid rgb(0, 0, 0); vertical-align: baseline; height: 50px; text-align: left; background-color: rgb(202, 150, 151); color: rgb(255, 255, 255);\"><th width=\"55%\" style=\"margin: 0px; padding: 0px 0px 0px 2em; border: 1px solid rgb(0, 0, 0); font-weight: normal; vertical-align: middle; text-align: left; width: 349.5px;\">旅行開始日の前日より起算して</th><th style=\"margin: 0px; padding: 0px 0px 0px 2em; border: 1px solid rgb(0, 0, 0);