/*Table structure for table `tmp_plans` */

DROP TABLE IF EXISTS `tmp_plans`;

CREATE TABLE `tmp_plans` (
  `company_id` bigint(20) unsigned DEFAULT NULL,
  `group_id` bigint(20) unsigned DEFAULT NULL,
  `genre_id` bigint(20) unsigned DEFAULT NULL,
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `sort` bigint(20) unsigned DEFAULT NULL,
  `kind` tinyint(3) unsigned DEFAULT NULL,
  `is_listed` tinyint(1) DEFAULT 1,
  `name` varchar(100) DEFAULT NULL,
  `catchphrase` varchar(100) DEFAULT NULL,
  `description` varchar(1200) DEFAULT NULL,
  `start_day` date DEFAULT NULL,
  `end_day` date DEFAULT NULL,
  `repetition_flag` tinyint(1) DEFAULT 0,
  `repetition_day` tinyint(4) DEFAULT NULL,
  `monday` tinyint(1) DEFAULT 0,
  `tuesday` tinyint(1) DEFAULT 0,
  `wednesday` tinyint(1) DEFAULT 0,
  `thursday` tinyint(1) DEFAULT 0,
  `friday` tinyint(1) DEFAULT 0,
  `saturday` tinyint(1) DEFAULT 0,
  `sunday` int(1) DEFAULT 0,
  `holiday_selected` tinyint(1) DEFAULT 1,
  `holiday_nonselected` tinyint(1) DEFAULT 1,
  `is_autoextend` tinyint(1) DEFAULT 0,
  `time_hour` tinyint(4) DEFAULT 0,
  `time_minute` tinyint(4) DEFAULT 0,
  `age_from` tinyint(4) DEFAULT NULL,
  `age_to` tinyint(4) DEFAULT NULL,
  `res_type` tinyint(4) DEFAULT 0,
  `res_end_flag` tinyint(1) DEFAULT 0,
  `res_before_day` tinyint(4) DEFAULT 100,
  `res_before_type` tinyint(1) DEFAULT 0,
  `res_before_time` tinyint(4) DEFAULT 0,
  `res_end_day` tinyint(4) DEFAULT 100,
  `res_end_type` tinyint(1) DEFAULT 0,
  `res_end_time` tinyint(4) DEFAULT 0,
  `req_before_day` tinyint(4) DEFAULT 100,
  `req_before_type` tinyint(1) DEFAULT 0,
  `req_before_time` tinyint(4) DEFAULT 0,
  `res_limit_flag` tinyint(1) DEFAULT 0,
  `res_limit_number` tinyint(4) DEFAULT NULL,
  `min_number` tinyint(4) DEFAULT NULL,
  `max_number` tinyint(4) DEFAULT NULL,
  `payment_method` tinyint(4) DEFAULT 0,
  `cache_flag` tinyint(1) DEFAULT 0,
  `card_flag` tinyint(1) DEFAULT 0,
  `visa` tinyint(1) DEFAULT 0,
  `mastercard` tinyint(1) DEFAULT 0,
  `americanexpress` tinyint(1) DEFAULT 0,
  `jcb` tinyint(1) DEFAULT 0,
  `unionpay` tinyint(1) DEFAULT 0,
  `diners` tinyint(1) DEFAULT 0,
  `discover` tinyint(1) DEFAULT 0,
  `etc_card` tinyint(1) DEFAULT 0,
  `etc_card_name` varchar(50) DEFAULT NULL,
  `payment_comment` varchar(200) DEFAULT NULL,
  `is_discount` tinyint(1) DEFAULT 0,
  `included_item` varchar(100) DEFAULT NULL,
  `place_name` varchar(120) DEFAULT NULL,
  `place_postalcode` varchar(8) DEFAULT NULL,
  `place_prefecture` varchar(5) DEFAULT NULL,
  `place_address` varchar(100) DEFAULT NULL,
  `place_access` varchar(120) DEFAULT NULL,
  `place_latitude` varchar(50) DEFAULT NULL,
  `place_longitude` varchar(50) DEFAULT NULL,
  `meeting_point_flag` tinyint(4) DEFAULT 0,
  `meeting_point_name` varchar(120) DEFAULT NULL,
  `meeting_point_postalcode` varchar(8) DEFAULT NULL,
  `meeting_point_prefecture` varchar(5) DEFAULT NULL,
  `meeting_point_address` varchar(100) DEFAULT NULL,
  `meeting_point_access` varchar(120) DEFAULT NULL,
  `meeting_point_latitude` varchar(50) DEFAULT NULL,
  `meeting_point_longitude` varchar(50) DEFAULT NULL,
  `question_flag` tinyint(1) DEFAULT 0,
  `question_content` varchar(1200) DEFAULT NULL,
  `answer_flag` tinyint(1) DEFAULT 0,
  `caution_flag` tinyint(1) DEFAULT 0,
  `caution_content` varchar(5000) DEFAULT NULL,
  `item` varchar(1000) DEFAULT NULL,
  `wear` varchar(1000) DEFAULT NULL,
  `file_path1` text DEFAULT NULL,
  `file_path2` text DEFAULT NULL,
  `file_path3` text DEFAULT NULL,
  `file_path4` text DEFAULT NULL,
  `file_path5` text DEFAULT NULL,
  `file_path6` text DEFAULT NULL,
  `file_path7` text DEFAULT NULL,
  `file_path8` text DEFAULT NULL,
  `file_path9` text DEFAULT NULL,
  `file_path10` text DEFAULT NULL,
  `spot` tinyint(1) DEFAULT 0,
  `prepay` tinyint(1) DEFAULT 0,
  `cvs` tinyint(1) DEFAULT 0,
  `card` tinyint(1) DEFAULT 0,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `group_id` (`group_id`),
  KEY `genre_id1` (`genre_id`),
  KEY `company_id` (`company_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

